import React from "react";

function Contador(props) {
  state = {};

  return (
    <div>
      <h1>Contador: {props.nombre}</h1>
      <p>El contador esta en 0</p>
      <button>Aumentar Contador</button>
    </div>
  );
}

export default Contador;
